import { Link } from "react-router-dom";
import React from 'react';
import './Header.scss';
import BrainFlix from '../../../src/assets/logo/BrainFlix-logo.svg';
import Mohan from "../../../src/assets/images/Mohan-muruge.jpg";

function Header() {
  return (
    <nav className="nav">
      <Link to="/">
        <img className="nav__logo" src={BrainFlix} alt="BrainFlix logo" />
      </Link>
      <img className="nav__avatar" src={Mohan} alt="avatar" />
      <input className="nav__search" type="text" placeholder="Search.." name="search" />
      <Link className="nav__link" to="/Upload">
        <button className="nav__link-button">UPLOAD</button>
      </Link>
    </nav>
  );
}

export default Header;
